export function add44(a: number, b: number): number {
  return a + b;
}

export function subtract44(a: number, b: number): number {
  return a - b;
}

export function multiply44(a: number, b: number): number {
  return a * b;
}

export function divide44(a: number, b: number): number {
  return a / b;
}
